pid_t
gpilotd_get_pid (void)
{
	FILE *f;
	const gchar *homedir;
	GString *str;
	gchar pidstr[100];
	pid_t pid;
	
	homedir = g_get_home_dir (); 
	if (!homedir)
		return -1;
	
	str = g_string_new (homedir);
	g_string_append (str, "/.gpilotd.pid");
	f = fopen (str->str, "r");
	g_string_free (str, TRUE);
	if (!f) {
		return -1;
	} else {
		if (fgets (pidstr, sizeof (pidstr), f) == NULL) {
			fclose(f);
			return -1;
		}			
		fclose (f);
		pid = strtol (pidstr, NULL, 10);
		if (pid == '\0')
			return -1;
		else
			return pid;
	}
}


